import React, {
    Fragment
} from 'react';
import Media from 'react-media';

const Header = () =>
    <
    div >
    <
    Media queries = {
        {
            small: "(max-width: 599px)",
            medium: "(min-width: 600px) and (max-width: 1199px)",
            large: "(min-width: 1200px)"
        }
    } > {
        matches => ( <
            Fragment > {
                matches.small && < p > I am small Header! < /p>} {
                    matches.medium && < p > I am medium Header! < /p>} {
                        matches.large && < p > I am large Header! < /p>} <
                            /Fragment>
                    )
                } <
                /Media> <
                /div>

                export default Header;
